import React, { useEffect } from 'react'
import '../App.css';

import Post from './Post'

const Posts = ({ data }) => {

    return (
        <div className="posts">
            {data.allPosts.map((post, index) => {
                return (
                    <Post 
                        key={index} 
                        post={post}
                    />
                )
            })}
        </div>
    )
}

export default Posts
